  @optionalTypeArgs
  TResult map<TResult extends Object?>({
    required TResult Function(SearchScreenInitial value) initial,
    required TResult Function(SearchScreenLoading value) loading,
    required TResult Function(SearchingInProgress value) searchingInProgress,
    required TResult Function(ChoosingFilters value) choosingFilters,
    required TResult Function(SearchScreenReady value) ready,
    required TResult Function(SearchScreenError value) error,
  }) {
    return error(this);
  }

  @override
  @optionalTypeArgs
  TResult? mapOrNull<TResult extends Object?>({
    TResult? Function(SearchScreenInitial value)? initial,
    TResult? Function(SearchScreenLoading value)? loading,
    TResult? Function(SearchingInProgress value)? searchingInProgress,
    TResult? Function(ChoosingFilters value)? choosingFilters,
    TResult? Function(SearchScreenReady value)? ready,
    TResult? Function(SearchScreenError value)? error,
  }) {
    return error?.call(this);
  }

  @override
  @optionalTypeArgs
  TResult maybeMap<TResult extends Object?>({
    TResult Function(SearchScreenInitial value)? initial,
    TResult Function(SearchScreenLoading value)? loading,
    TResult Function(SearchingInProgress value)? searchingInProgress,
    TResult Function(ChoosingFilters value)? choosingFilters,
    TResult Function(SearchScreenReady value)? ready,
    TResult Function(SearchScreenError value)? error,
    required TResult orElse(),
  }) {
    if (error != null) {
      return error(this);
    }
    return orElse();
  }
}

abstract class SearchScreenError implements SearchScreenState {
  factory SearchScreenError() = _$SearchScreenError;
}
